window.onload = function () {
    var gameConfig = {
        type: Phaser.CANVAS,
        width: 512,
        height: 800,
        // transparent: true,
        backgroundColor: 0xffffff,
        physics: {
            default: 'matter',
            matter: {
                gravity: {
                    y: 0.8
                },
                enableSleep: false,
                debug: true
            }
        },
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);

}











